    useEffect(() => {
        (async () => {
            const response = await fetch("http://localhost:8000/api/ur",
                {
                    method: 'GET',
                    headers: { 'Content-Type': 'application/json' },
                    credentials: 'include',
                });
            const content = await response.json();
            setName(content.name)
        })();
    })
    return (

        <div> Successfully Logged Out</div>
    );
}
